// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./Ownable.sol";
import "./IdentityRegistry.sol";

// Token de sécurité pour un projet immobilier
contract HouseSecurityToken is Ownable {
    // Token metadata
    string public name;
    string public symbol;
    uint8 public constant decimals = 0;
    uint256 public constant MAX_INVESTOR_PERCENT = 20;

    // Supply
    uint256 public totalSupply;
    uint256 public maxSupply;

    mapping(address => uint256) public balanceOf;

    // Access control
    address public projectOwner;
    address public factory;
    address public saleContract;

    // KYC registry
    IIdentityRegistry public identityRegistry;

    // Pause mechanism
    bool public paused;

    // Events
    event Transfer(address indexed from, address indexed to, uint256 amount);
    event Mint(address indexed to, uint256 amount);
    event Burn(address indexed from, uint256 amount);
    event Paused(address indexed by);
    event Unpaused(address indexed by);
    event SaleContractUpdated(address indexed oldSale, address indexed newSale);

    // Modifiers
    modifier onlyProjectOrPlatformOrSale() {
        require(
            msg.sender == projectOwner ||
                msg.sender == owner ||
                msg.sender == saleContract,
            "Token: caller not authorized"
        );
        _;
    }

    modifier whenNotPaused() {
        require(!paused, "Token: transfers paused");
        _;
    }

    // Constructor
    constructor(
        address platformOwner,
        address _projectOwner,
        string memory _name,
        string memory _symbol,
        uint256 _maxSupply,
        address _identityRegistry
    ) Ownable(platformOwner) {
        require(_projectOwner != address(0), "Token: projectOwner zero");
        require(_identityRegistry != address(0), "Token: identityRegistry zero");

        projectOwner = _projectOwner;
        name = _name;
        symbol = _symbol;
        maxSupply = _maxSupply;
        identityRegistry = IIdentityRegistry(_identityRegistry);
        factory = msg.sender; // la factory est le déployeur
    }


    function setSaleContract(address _saleContract) external onlyOwner {
        emit SaleContractUpdated(saleContract, _saleContract);
        saleContract = _saleContract;
    }

    // Internal checks
    function _checkKYC(address wallet) internal view {
        require(identityRegistry.isVerified(wallet), "Token: wallet not KYC");
    }

    function _checkMaxSupply(uint256 amount) internal view {
        if (maxSupply != 0) {
            require(
                totalSupply + amount <= maxSupply,
                "Token: maxSupply exceeded"
            );
        }
    }

    function _checkInvestorCap(uint256 newBalance) internal view {
        if (maxSupply == 0) return;
        uint256 maxAllowed = (maxSupply * MAX_INVESTOR_PERCENT) / 100;

        require(
            newBalance <= maxAllowed,
            "Token: exceeds 20% investor cap"
        );
    }

    // Admin functions
    function pause() external onlyOwner {
        paused = true;
        emit Paused(msg.sender);
    }

    function unpause() external onlyOwner {
        paused = false;
        emit Unpaused(msg.sender);
    }

    // Mint / Burn
    function mint(address to, uint256 amount)
        external
        onlyProjectOrPlatformOrSale
    {
        require(to != address(0), "Token: mint to zero");
        require(amount > 0, "Token: amount zero");

        _checkKYC(to);
        _checkMaxSupply(amount);
        _checkInvestorCap(balanceOf[to] + amount);

        balanceOf[to] += amount;
        totalSupply += amount;

        emit Mint(to, amount);
        emit Transfer(address(0), to, amount);
    }

    function burn(address from, uint256 amount)
        external
        onlyProjectOrPlatformOrSale
    {
        require(from != address(0), "Token: burn from zero");
        require(balanceOf[from] >= amount, "Token: insufficient balance");

        balanceOf[from] -= amount;
        totalSupply -= amount;

        emit Burn(from, amount);
        emit Transfer(from, address(0), amount);
    }

    // Transfer
    function transfer(address to, uint256 amount)
        external
        whenNotPaused
        returns (bool)
    {
        address from = msg.sender;

        require(to != address(0), "Token: transfer to zero");
        require(amount > 0, "Token: amount zero");
        require(balanceOf[from] >= amount, "Token: insufficient balance");

        _checkKYC(from);
        _checkKYC(to);
        _checkInvestorCap(balanceOf[to] + amount);

        balanceOf[from] -= amount;
        balanceOf[to] += amount;

        emit Transfer(from, to, amount);
        return true;
    }
}

blockchain/contracts/IdentityRegistry.so.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./Ownable.sol";

// Interface minimale de l'Identity Registry
interface IIdentityRegistry {
    function isVerified(address wallet) external view returns (bool);
}

contract IdentityRegistry is IIdentityRegistry, Ownable {
    mapping(address => bool) private _isVerified;

    event InvestorVerified(address indexed wallet);

    event InvestorRevoked(address indexed wallet);

    constructor(address platformOwner) Ownable(platformOwner) {}


    function verifyInvestor(address wallet) external onlyOwner {
        require(wallet != address(0), "IdentityRegistry: wallet is zero");
        require(!_isVerified[wallet], "IdentityRegistry: already verified");

        _isVerified[wallet] = true;
        emit InvestorVerified(wallet);
    }

    function revokeInvestor(address wallet) external onlyOwner {
        require(wallet != address(0), "IdentityRegistry: wallet is zero");
        require(_isVerified[wallet], "IdentityRegistry: not verified");

        _isVerified[wallet] = false;
        emit InvestorRevoked(wallet);
    }

    function isVerified(address wallet) external view override returns (bool) {
        return _isVerified[wallet];
    }
}

